import React, { useState } from 'react';
import '../styles/ObjetiveSelection.scss';

const ObjectiveSelection = ({ players }) => {

    return (
        <div className='objetive-selection-container'>
            {players.map((player, index) => (
                <tr key={index}>
                    <td>
                        <button onClick={() => handlePlayerClick(player)}>
                            {player}
                        </button>
                    </td>
                </tr>
            ))}
        </div>
    );
};

export default ObjectiveSelection;
